  false,\n\t\"url\": null,\n\t\"notes\": \"These data are a compilation of currently
  available seagrass GIS data sets for the west coast of the United States. These
  data have been compiled from seventeen different data sources. The source data were
  acquired over a large range of time periods, at many different spatial resolutions
  using a variety of methods, including aerial photography, videography, multispectral
  sensors, sonar, and field surveys. Users are cautioned to use these data as only
  a regional view of seagrass locations. Areas without mapped seagrass may contain
  seagrass, but digital data were unavailable during this data compilation\",\n\t\"license_title\":
